// Params: action - enable, disable
let modalContent = `Do you want to ${action} this record?`

VV.Form.Global.DisplayModal({
    "Icon": "warning",
    "Title": "Confirm",
    "HtmlContent": modalContent,
    "okFunction": enableOrDisable
})

function enableOrDisable() {
    if (action === 'enable') {
        VV.Form.SetFieldValue("Status", "Enabled")
    } else {
        VV.Form.SetFieldValue("Status", "Disabled")
    }
    VV.Form.DoAjaxFormSave();
}

