// Name of Template - must be completed.
if (ControlName == "Name of Template" || RunAll) {
  if (
    VV.Form.Global.CentralValidation(VV.Form.GetFieldValue("Name of Template"), "Blank") ==
    false
  ) {
    errorMessage = "The Name of Template must be completed.";
    VV.Form.SetValidationErrorMessageOnField("Name of Template", errorMessage);
