  } else {
    VV.Form.ClearValidationErrorOnField("Name of Template");
  }
}

// Department - Dropdown must be selected
if (
    ControlName == "Department" ||
    RunAll
  ) {
    var isSelectItem =
      VV.Form.Global.CentralValidation(
        VV.Form.getDropDownListText("Department"),
        "DDSelect"
      ) == false;
    var isBlank =
      VV.Form.Global.CentralValidation(
        VV.Form.getDropDownListText("Department"),
        "Blank"
      ) ==
      false; /* added as a workaround to getddtext occasionally returning empty string - 7/14/2021 */
    if (isSelectItem || isBlank) {
      VV.Form.SetValidationErrorMessageOnField(
        "Department",
        "Please make a selection from the Department dropdown."
